import React, { Component } from 'react';
import {Route,NavLink} from 'react-router-dom';
import ProductBody from '../products/productsbody';

class DashBody extends Component{
  constructor(props) {
    super(props)

    this.state = {
        user: [],
        config: {
            headers: { 'Authorization': `Bearer ${localStorage.getItem('token')}` }
        }
    }
}

logoutHandle =()=>{
  localStorage.removeItem('token');
  this.props.history.push('/');
}



    render(){
        return(
          <div>
            <nav className="navbar navbar-light bg-light sticky-top">
               <div className="container">
                 <NavLink className="navbar-brand" to="/">Grocery Store Dashboard</NavLink>
                    <ul className="nav navbar-nav navbar-right">
                        <li><NavLink className="navbar-brand sub-navlink" to="/products">Products</NavLink></li>
                        <li><NavLink className="navbar-brand sub-navlink" to="/register">Your cart</NavLink></li>                  
                        <li><button className="btn btn-primary" type="submit" onClick={this.logoutHandle}>Logout</button></li>
                    </ul>
                 </div>
              </nav>
              <Route path="/products" exact component={ProductBody}/>
          </div>    
        );
    }
}

export default DashBody;
